import * as React from 'react';
import Box from '@mui/material/Box';
import './Myaccount.css'
import Button from '@mui/material/Button';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';
import InputBase from '@mui/material/InputBase';
import { alpha, styled } from '@mui/material/styles';
import InputLabel from '@mui/material/InputLabel';
import FormControl from '@mui/material/FormControl';



function Myaccount() {
  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
  
  };
  const BootstrapInput = styled(InputBase)(({ theme }) => ({
    'label + &': {
      marginTop: theme.spacing(3),
    },
    '& .MuiInputBase-input': {
      borderRadius: 5,
      position: 'relative',
      backgroundColor: theme.palette.mode === 'light' ? 'rgba(255, 255, 255, 0.341)' : '#2b2b2b',
      border: '1px solid rgb(153, 80, 180)',
      fontSize: 17,
      width: 'auto',
      padding: '10px 12px',
      transition: theme.transitions.create([
        'border-color',
        'background-color',
        'box-shadow',
      ]),
      // Use the system font instead of the default Roboto font.
      fontFamily: [
        '-apple-system',
        'BlinkMacSystemFont',
        '"Segoe UI"',
        'Roboto',
        '"Helvetica Neue"',
        'Arial',
        'sans-serif',
        '"Apple Color Emoji"',
        '"Segoe UI Emoji"',
        '"Segoe UI Symbol"',
      ].join(','),
      '&:focus': {
        boxShadow: '0px 0px 5px #b393d3, 0px 0px 10px #b393d3, 0px 0px 10px #b393d3, 0px 0px 20px #b393d3',
        borderColor:"purple",
      },
    },
  }));
 
  return (
    <Box style={{marginTop: '5px',display: 'flex',justifyContent: 'center', alignItems: 'center' }} >
      <Box style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', maxWidth: '100%', overflow: 'auto', }}> 
    <Box className="box1">
  
     <Box className="mainContainer">

                <Box className="inputcontainer" sx={{backgroundColor: "black"}}>
                </Box>
                <Box  sx={{ height: "100%",width: "50%"}}>
                        
                         <Box className="logincontainer">
                         
                         <Box className="login" >
                         <h2>Login</h2>
                         </Box>
                        
                         <Box component="form" onSubmit={handleSubmit} noValidate sx={{ display: 'grid', margin:"10px" ,gridTemplateColumns: { sm: '1fr 1fr' }, gap: 2,}}>
           
      <FormControl variant="standard">
      <Box>
         <InputLabel shrink htmlFor="email-input" sx={{color:"gris"}}>
        Email
        </InputLabel>
        <BootstrapInput  id="email-input" />
        </Box>


        
        <Box>
        <InputLabel shrink  htmlFor="password-input" sx={{color:"gris" ,margin:"90px"}}>
        Password
        </InputLabel>
        <BootstrapInput  id="password-input"  />
        
        </Box>
      </FormControl>
     
    </Box>



            <FormControlLabel
              control={<Checkbox value="remember" color="primary"sx={{color:"purple"}} />}
              label="Remember me"
            />
          
            <Button
              type="submit"
              
              variant="contained"
              sx={{ mt: 2, mb: 2 }}
            >
              Sign In
            </Button>
            <Grid container >
              <Grid item xs>
                <Link href="#" variant="body2" sx={{color:"purple"}}>
                  Forgot password?
                </Link>
              </Grid>
              <Grid item>
                <Link href="#" variant="body2" sx={{color:"purple"}}>
                  {"Don't have an account? Sign Up"}
                </Link>
              </Grid>
            </Grid>
          </Box>
                    
                    </Box>
                         </Box>

                
               </Box>
     
     </Box>
      </Box> 
     
     
  );
}
export default  Myaccount;
